const defaultState = {
    mykey:1
}
export default (state=defaultState,action) =>{
    let newState = JSON.parse(JSON.stringify(state))

    switch(action.type){
        case 'addKeyFn':
            console.log(newState.mykey)
            newState.mykey++;
            console.log(newState.mykey)
            break
        default:
            break
    }

    return newState
}
